/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `luuThayDoiForInsertHoKhau` AFTER INSERT ON `hokhau` FOR EACH ROW begin
	declare hotenNguoiThayDoi varchar(50);
    declare noidungthaydoi varchar(300);
    select HoTen into hotenNguoiThayDoi from nhankhau where CCCD = new.ChuHoID;
    set noidungthaydoi = concat(N'Hộ ',new.SoHK,N' được tạo mới ở địa chỉ ',new.DiaChi,N' với chủ hộ là ',hotenNguoiThayDoi,' (',new.ChuHoID,')');
    insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.SoHK,curdate(),noidungthaydoi);
end */;;
