/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `luuThayDoiForUpdateHoKhau` AFTER UPDATE ON `hokhau` FOR EACH ROW begin
	declare hotenNguoiThayDoi varchar(50);
    declare noidungthaydoi varchar(300);
    select HoTen into hotenNguoiThayDoi from nhankhau where CCCD = new.ChuHoID;
    if(new.ChuHoID <> old.ChuHoID) then
		set noidungthaydoi = concat(N'Thay đổi chủ hộ thành: ',hotenNguoiThayDoi,' (',new.ChuHoID,')');
		insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.SoHK,curdate(),noidungthaydoi);
	end if;
    if(new.DiaChi <> old.DiaChi) then
		set noidungthaydoi = concat(N'Thay đổi địa chỉ thành: ',new.DiaChi);
		insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.SoHK,curdate(),noidungthaydoi);
	end if;
end */;;
