/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `luuThayDoiForInsertNhanKhauHoKhau` AFTER INSERT ON `nhankhau_hokhau` FOR EACH ROW begin
	declare hotenNguoiThayDoi varchar(50);
    declare noidungthaydoi varchar(300);
    declare endDate varchar(10);
    if(new.NgayKetThuc = '2100-01-01') then set endDate = '';
    else set endDate = convert(new.NgayKetThuc,char);
    end if;
    select HoTen into hotenNguoiThayDoi from nhankhau where CCCD = new.NhanKhauID;
    
	if (new.LoaiLuuTru = N'Thường trú') then
        set noidungthaydoi = concat(N'Thêm thành viên ',hotenNguoiThayDoi,' (',new.NhanKhauID,N') từ ',convert(new.NgayBatDau,char),
										N' đến ',endDate);
		insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.HoKhauID,curdate(),noidungthaydoi);
    elseif (new.LoaiLuuTru = N'Tạm trú') then
		set noidungthaydoi = concat(N'Thêm thành viên ',hotenNguoiThayDoi,' (',new.NhanKhauID,N') từ ',convert(new.NgayBatDau,char),
										N' đến ',endDate);
		insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.HoKhauID,curdate(),noidungthaydoi);
    else
		set noidungthaydoi = concat(N'Thành viên ',hotenNguoiThayDoi,' (',new.NhanKhauID,N') tạm vắng từ ',convert(new.NgayBatDau,char),
										N' đến ',endDate);
		insert into ThayDoi (HoKhauID,NgayThayDoi,NoiDung) values (new.HoKhauID,curdate(),noidungthaydoi);
    end if;
end */;;
