CREATE DEFINER=`root`@`localhost` FUNCTION `age`(dob date) RETURNS int
BEGIN
	declare tmp int;
	declare age int;
	set tmp = year(curdate())-year(dob);
	if month(dob) > month(curdate()) or (month(dob) = month(curdate()) and day(dob) > day(curdate()))
	then set age = tmp - 1;
	else set age = tmp;
	end if;
	return age;
END ;;
